class Solution {

    /**
     * @param Integer[][] $grid
     * @return Integer[]
     */
    function findMissingAndRepeatedValues($grid) {
        $n = count($grid);
        $numCounts = array_fill(1, $n * $n, 0);

        foreach ($grid as $row) {
            foreach ($row as $num) {
                $numCounts[$num]++;
            }
        }

        $missing = null;
        $repeated = null;

        for ($i = 1; $i <= $n * $n; $i++) {
            if ($numCounts[$i] == 0) {
                $missing = $i;
            } elseif ($numCounts[$i] == 2) {
                $repeated = $i;
            }
        }

        return [$repeated, $missing];
    }
}
